import React, { Component } from "react";
import { db } from "../fire";
import { Button } from "reactstrap";

export default class SelectMultiple extends Component {
  state = {
    data: [],
    selectedLabels: []
  };
  componentDidMount() {
    db.collection("Images")
      .get()
      .then(querySnapshot => {
        const data = querySnapshot.docs.map(doc => doc.data());
        //console.log(data);
        var temp = [];
        for (var i = 0; i < data.length; i++) {
          temp.push(data[i].label);
        }
        //console.log(temp);
        this.setState({ data: temp }); // array of cities objects
      });
  }
  render() {
    return (
      <div>
        {this.state.data.map((label, index) => (
          <Button color="primary" key={index}>
            {label}
            {"    "}
          </Button>
        ))}
      </div>
    );
  }
}
